Le lao ou laotien (autonyme : ພາສາລາວ, /pʰaː˦.saː˨˦.laːw˦/) est une langue du groupe taï, de la branche dite kam-taï de la famille des langues taï-kadaï. C'est la langue officielle du Laos. D'un point de vue linguistique, le lao est directement apparenté à l'isan parlé dans la région nord-est de la Thaïlande (raison pour laquelle on appelle aussi cette langue « thaï du Nord-Est »), et fait avec celle-ci partie d'un sous-groupe des langues taï, dit lao-phutai. L'isan et le lao sont suffisamment proches pour que des deux côtés de la frontière entre les deux pays, ils forment un continuum linguistique. Le thaï proprement dit, langue officielle de la Thaïlande sous le nom de « thaïlandais », appartient à un autre sous-groupe appelé chiang saeng (du nom d'une localité située dans le Triangle d'or dans le nord de la Thaïlande). Le thaï et le lao ne sont pas mutuellement intelligibles. En termes de typologie sociolinguistique, il s'agit donc de langues par distance (Abstand) plutôt que de langues par élaboration (Ausbau). La langue lao peut se diviser en cinq dialectes régionaux : 
* le lao de Vientiane ; 
* le lao du Nord (Luang Prabang) ; 
* le lao du Nord-Est (Xieng Khouang) ; 
* le lao du Centre (Khammouane) ; 
* le lao du Sud (Champassak). Le lao de Vientiane est globalement bien compris dans tout le pays.
